import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import { ChatProvider } from './context/ChatContext';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import Dashboard from './pages/Dashboard';
import Predict from './pages/Predict';
import BatchPredict from './pages/BatchPredict';
import Chat from './pages/Chat';
import Profile from './pages/Profile';
import ProtectedRoute from './components/common/ProtectedRoute';
import PageNotFound from './pages/PageNotFound'; // New component
import Layout from './layouts/Layout'; // New layout component
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

// Enhanced Material-UI theme
const theme = createTheme({
  palette: {
    primary: {
      main: '#6a11cb',
      contrastText: '#ffffff',
    },
    secondary: {
      main: '#2575fc',
      contrastText: '#ffffff',
    },
    error: {
      main: '#ff5252',
    },
    background: {
      default: '#f5f7fa',
      paper: '#ffffff',
    },
  },
  typography: {
    fontFamily: [
      'Roboto',
      '-apple-system',
      'BlinkMacSystemFont',
      '"Segoe UI"',
      'sans-serif'
    ].join(','),
    h5: {
      fontWeight: 600,
    },
  },
  shape: {
    borderRadius: 8,
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          textTransform: 'none',
          fontWeight: 600,
        },
      },
    },
    MuiCard: {
      styleOverrides: {
        root: {
          boxShadow: '0 4px 12px rgba(0,0,0,0.05)',
          border: '1px solid #e0e0e0',
        },
      },
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Router>
        <AuthProvider>
          <ChatProvider>
            {/* Toast notifications container */}
            <ToastContainer
              position="top-right"
              autoClose={5000}
              hideProgressBar={false}
              newestOnTop
              closeOnClick
              rtl={false}
              pauseOnFocusLoss
              draggable
              pauseOnHover
              theme="light"
            />
            
            <Routes>
              {/* Public routes */}
              <Route element={<Layout />}>
                <Route path="/" element={<Home />} />
                <Route path="/login" element={<Login />} />
                <Route path="/register" element={<Register />} />
                
                {/* Protected routes */}
                <Route path="/dashboard" element={
                  <ProtectedRoute allowedRoles={['patient', 'doctor']}>
                    <Dashboard />
                  </ProtectedRoute>
                } />
                
                <Route path="/predict" element={
                  <ProtectedRoute allowedRoles={['patient', 'doctor']}>
                    <Predict />
                  </ProtectedRoute>
                } />
                
                {/* Doctor-only route */}
                <Route path="/batch-predict" element={
                  <ProtectedRoute allowedRoles={['doctor']}>
                    <BatchPredict />
                  </ProtectedRoute>
                } />
                
                <Route path="/chat" element={
                  <ProtectedRoute allowedRoles={['patient', 'doctor']}>
                    <Chat />
                  </ProtectedRoute>
                } />
                
                <Route path="/profile" element={
                  <ProtectedRoute allowedRoles={['patient', 'doctor']}>
                    <Profile />
                  </ProtectedRoute>
                } />
                
                {/* 404 catch-all route */}
                <Route path="*" element={<PageNotFound />} />
              </Route>
            </Routes>
          </ChatProvider>
        </AuthProvider>
      </Router>
    </ThemeProvider>
  );
}

export default App;
